import firebase from 'firebase';
import React, { Component } from 'react';


export default class Apps extends Component{
    constructor(props){
        super(props)
        this.state = {
            umid:[], 
            temp:[],
            date:[]
        };

    }
    componentDidMount(){
        this.loadData();
        var TWEETSREF = firebase.database().ref();
    }

    loadData = () => {
        TWEETSREF.on("value", (snapshot)=> {
        this.setState({umid:  snapshot.val().umidade});
        this.setState({temp:  snapshot.val().temperature});
        this.setState({date:  snapshot.val().dateRegister})
    })
    };

    render(){
        return (
            <div className="dataList">
            <h1>{this.state.umid}</h1>
            <h1>{this.state.temp}</h1>
            <h1>{this.state.date}</h1>
            </div>
        ) 
    }
}
